import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        info: []
     }
     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response)
              this.setState({
                 info: response.data[0]
             })
         })
         .catch(error => {
             console.log(error)
         })
     }

    render() { 

        let { info } = this.state

        return ( 
            <div>
                {
                    info.map((data, index) => {
                        return(
                            <div key={index}>
                            {data.name}
                        </div>
                        )
                    })
                }
            </div>
         );
    }
}

export default Main;
